import SimpleImageSlider from "react-simple-image-slider";

const images = [
  {
    url: "https://media.istockphoto.com/photos/successful-shopping-a-woman-shopaholic-opening-the-car-door-to-load-a-picture-id1310991531?b=1&k=20&m=1310991531&s=170667a&w=0&h=m9mKJbDUbIt0uPcLYLNsl4Q3ZcxjDzFsIL6ejJMkEHg=",
  },
  { url: "images/2.jpg" },
  { url: "images/3.jpg" },
  { url: "images/4.jpg" },
  { url: "images/5.jpg" },
  { url: "images/6.jpg" },
  { url: "images/7.jpg" },
];

export const Slider = () => {
  return (
    <div>
      <SimpleImageSlider
        width={896}
        height={504}
        images={images}
        showBullets={true}
        showNavs={true}
      />
    </div>
  );
};
